function Header({ onExportJSON, onExportHTML }) {
  return (
    <header className="header">
      <div>
        <h1 className="logo">CanvasX</h1>
        <p className="subtitle">Visual Web Builder Studio</p>
      </div>

      <button className="export-top-btn" onClick={onExportHTML}>
        Export
      </button>
    </header>
  );
}

export default Header;
